import React from 'react';
import { TextField, FormControlLabel, Checkbox } from '@mui/material';

const DateCreated = ({ date, isSorted, onSortChange }) => {
  const handleSortChange = (e) => {
    onSortChange(e.target.checked);
  };

  return (
    <div>
      <TextField
        value={date}
        variant="outlined"
        size="small"
        fullWidth
        placeholder="Дата отправки"
        inputProps={{ style: { width: '60%' } }} // Уменьшение ширины поля ввода на 40%
        disabled
      />
      <FormControlLabel
        control={<Checkbox checked={isSorted} onChange={handleSortChange} />}
        label="Сортировка"
      />
    </div>
  );
};

export default DateCreated;
